import React, { useState, useContext, useCallback } from "react";
import { useFocusEffect } from "@react-navigation/native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import axios from "axios";
import baseUrlGenerator from "../../generator/baseUrlGenerator";
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  Image,
  StyleSheet,
} from "react-native";
import OrderCard from "../Admin/OrderCard";

import AuthenticateGlobal from "../../ContextApi/store/AuthenticateGlobal";
import { userLogout } from "../../ContextApi/actions/Authentication";
import { useEffect } from "react/cjs/react.development";
import Header from "../welcomeHeader/Header";

const UserProfile = (props) => {
  const { userState } = useContext(AuthenticateGlobal);
  const context = useContext(AuthenticateGlobal);
  const [userProfile, setUserProfile] = useState();
  const [storeOrders, setStoreOrders] = useState();
  const [token, setToken] = useState();

  useFocusEffect(
    useCallback(() => {
      if (userState.isAuth === false || userState.isAuth === null) {
        props.navigation.navigate("Login");
      }

      AsyncStorage.getItem("token")
        .then((res) => {
          axios
            .get(`${baseUrlGenerator}onlineUser/${userState.userProfile._id}`, {
              headers: { Authorization: `Bearer ${res}` },
            })
            .then((user) => {
              AsyncStorage.setItem("user", JSON.stringify(user.data));
              setUserProfile(user.data);
              //console.log(user);
              console.log("na me", user.data);
            });
        })
        .catch((err) => console.log("USERPROFILE", err));

      //fetch orders by user id
      axios
        .get(`${baseUrlGenerator}onlineOrder`)
        .then((item) => {
          const data = item.data;
          const userOrders = data;
          console.log("YYYYYY", userOrders);
          const storeOrder = userOrders?.filter(
            (order) => {
              return order?.user?._id === userState?.userProfile?._id;
            }

            // order?.user?._id.includes(`62ce7f81045966947cf31234`);
            // console.log("[ORDER]:", order)
            // console.log("DONT DISAPPEAR", userState?.userProfile?._id);
            // console.log("ORDER USER", order.user);
            // console.log("ORDER USER ID", order?.user?._id);
          );

          setStoreOrders(storeOrder);
        })
        .catch((error) => console.log("Error loading Orders", error));

      return () => {
        setUserProfile();
        setStoreOrders();
      };
    }, [userState.isAuth])
  );

  return (
    <>
      <View style={styles.header}>
        <Text
          style={{
            marginTop: 38,
            marginLeft: 20,
            fontSize: 20,
            fontWeight: "bold",
          }}
        >
          My Profile
        </Text>

        <TouchableOpacity
          onPress={() => {
            AsyncStorage.removeItem("token");
            userLogout(context?.dispatch);
          }}
        >
          <View
            style={{
              width: 130,
              height: 40,
              marginRight: 20,
              backgroundColor: "#1662A2",
              marginTop: 33,
              borderRadius: 10,
            }}
          >
            <Text
              style={{
                fontSize: 17,
                fontWeight: "bold",
                color: "#fff",
                marginLeft: 30,
                marginTop: 7,
              }}
            >
              Log Out
            </Text>
          </View>
        </TouchableOpacity>
      </View>

      <View
        style={{
          width: 370,
          height: 180,
          backgroundColor: "#EBF2F4",
          marginTop: 10,
          borderRadius: 10,
          alignSelf: "center",
        }}
      >
        <View
          style={{
            width: 80,
            height: 80,
            borderRadius: 50,
            backgroundColor: "red",
            alignSelf: "center",
            marginTop: -40,
          }}
        ></View>

        <View style={{ marginTop: 10 }}>
          <Text
            style={{
              fontSize: 16,
              marginLeft: 20,
              fontWeight: "bold",
              color: "#000",
            }}
          >
            Name: &nbsp;&nbsp;&nbsp; {userProfile ? userProfile.name : ""}
          </Text>
          <Text
            style={{
              fontSize: 16,
              marginLeft: 20,
              marginTop: 5,
              fontWeight: "bold",
              color: "#000",
            }}
          >
            E-mail: &nbsp;&nbsp;&nbsp; {userProfile ? userProfile.email : ""}
          </Text>
          <Text
            style={{
              fontSize: 16,
              marginLeft: 20,
              marginTop: 5,
              fontWeight: "bold",
              color: "#000",
            }}
          >
            Phone: &nbsp;&nbsp;&nbsp;{" "}
            {userProfile ? userProfile.phoneNumber : ""}
          </Text>
          <Text
            style={{
              fontSize: 16,
              marginLeft: 20,
              marginTop: 5,
              fontWeight: "bold",
              color: "#000",
            }}
          >
            Address: &nbsp;&nbsp;&nbsp; {userProfile ? userProfile.street : ""}
          </Text>
        </View>
      </View>

      <ScrollView>
        <View>
          <Text>Hello </Text>
          <View>
            {storeOrders ? (
              storeOrders.map((item) => {
                return <OrderCard key={item.id} {...item} />;
              })
            ) : (
              <View>
                <Text>No orders Available</Text>
              </View>
            )}
          </View>
        </View>
      </ScrollView>
    </>
  );
};

const styles = StyleSheet.create({
  header: {
    flexDirection: "row",
    justifyContent: "space-between",
    width: "100%",
    height: 80,
    backgroundColor: "white",
  },
});
export default UserProfile;
